import { useContext } from "react";
import { StartPage } from "../StartPage";
import { GlobalState } from "../global_states/global_state";
import { GlobalStates } from "../states";
import { GamePage } from "./game_page";
import { currentUserInfo, setCurrentUserInfo } from "../global_states/initial_states";

export function Pages() {
    const currUser = {currentUserInfo}
    if (currUser.signerAddress !== "-") {
        return (<GamePage />)
    } else return (<StartPage />)
}

export function Pages1() {
    const { currentUserInfo } = useContext(GlobalState);
    if (currentUserInfo.signerAddress !== "-") {
        return (<GamePage />)
    } else return (<StartPage />)
}
